var kiwi = require('kiwi'),
    sys = require('sys'),
    express = kiwi.require('express'),
    http = require('express/http'),
    View = require('express/plugins/view').View

var ROOT = "http://localhost:3000"
    BACKEND_ROOT = "http://localhost:9000",
    NAME = "node"

var photos  = [],
    clients = {};

// Configure express
configure(function() {
  use(Logger)
  use(MethodOverride)
  use(ContentLength)
  use(Cookie)
  use(Session, { lifetime: (15).minutes, reapInterval: (1).minute })
  use(Static)
  set('root', __dirname)
})

// Send test
get('/send', function() {
  var that = this

  sys.puts("Sending to " + BACKEND_ROOT + "/imageWithCallback")
  http.post(BACKEND_ROOT + "/imageWithCallback", { 
    title: 'title', 
    description: 'description', 
    image: '', 
    callback: ROOT + '/status'
  }, function(error, data) {
    that.respond(200, "done: " + data)
  })
});


// Handle statuses
post('/status', function() {
  sys.puts("Got status for " + this.param('id') + ": " + this.param('status'))
  this.respond(200, "done")
});

// Start express server
run()
